import React,{useState} from "react";
import QrReader from 'react-qr-reader'

const Email = () => {

const[result,setResult] = useState('');
const [value, setValue] = useState([]);

const handleScan = data => {
  if (data) {
    setResult({
      result: data
    })
  }
}
const handleError = err => {
  console.error(err)
}

const handleChange =event=>{
  event.preventDefault();
  setValue(event.target.value);
}

return (
  <div className=" row  text-white bg-dark">
        <div className="col-6">
        <QrReader
          delay={300}
          onError={handleError}
          onScan={handleScan}
          style={{ width: '100%' }}
        
        />
         </div>
  <div className="col-6">
<form>
  <div class="form-group">
    <label for="exampleInputEmail1"><h1>Email address</h1></label>
    <input type="email" class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" value={value} onChange={handleChange}/>
    <small id="emailHelp" class="form-text text-muted">We'll never share your email with anyone else.</small>
  </div>
  <div class="form-group">
    <label for="exampleInputPassword1">Password</label>
    <input type="password" class="form-control" id="exampleInputPassword1" />
  </div>
  <div class="form-group form-check">
    <input type="checkbox" class="form-check-input" id="exampleCheck1" />
    <label class="form-check-label" for="exampleCheck1">Check me out</label>
  </div>
  <button type="submit" class="btn btn-primary">Submit</button>
</form>
</div>
</div>
);
};

export default Email;
